module.exports = "<app-chapter-hat [data]=\"chapterHatInfo\"></app-chapter-hat>\n<article \n    class=\"chapter-content\"\n    #articleContainer>\n    <!-- Share aqui -->\n    <div class=\"container-fluid\">\n        <div class=\"row\">\n            <div class=\"col-md-6 offset-md-3 col-sm-10 offset-sm-1 col-12\">\n                <p>O grande desafio continua sen-do tornar o Ismart conhecido para que mais jovens talen-tosos possam ter a oportunidade de se desenvolver por meio da educação. Uma vez no projeto, a intenção é ajudá-los a nunca duvidarem do seu potencial e a se apropriarem da sua história com protagonismo, resiliência e perseverança. </p>\n                <p>Quanto ao trabalho do Instituto e os programas de desenvolvimento oferecidos aos jovens, há o constante monitoramento de tendências de mercado. Uma das principais mudanças nos programas de desenvolvimento dos bolsistas foi o início do trabalho com foco em competências socio-emocionais, a reestruturação do pro-grama de orientação profissional, a aprendizagem baseada em projetos e a integração desses alunos às tendências de letramento digital.</p>\n                <p>Entre muitas expectativas, há também um sonho grande: a de que um dia um graduado pelo Ismart venha a fazer parte do Conselho do Instituto, representando a comunidade e dando voz aos principais interessados no projeto: bolsistas e Alumni.</p>\n                <p class=\"text-big\">Nos últimos 20 anos, mais de quatro mil jovens mudaram sua realidade e estão contribuindo para uma sociedade melhor. Para os próximos 20 anos...</p>\n            </div>\n        </div>\n        <div class=\"row\">\n            <figure class=\"chapter-content__img mb-0\">\n                <img src=\"assets/images/eduardo-braga.jpg\" alt=\"\">\n                <div class=\"container-fluid\">\n                    <div class=\"col-md-6 offset-md-3 col-sm-10 offset-sm-1 col-12\">\n                        <figcaption><img src=\"assets/images/camera.svg\" alt=\"\">Eduardo Braga da Costa - Projeto Ismart Online - São Paulo</figcaption>\n                    </div>\n                </div>\n            </figure>\n        </div>\n    </div>\n</article>\n<app-testimonials\n\t#testimonialComponent\n\t(onTestimonialCardClick)=\"modal.openModal()\">\n</app-testimonials>\n<app-testimonials\n    [modeDark]=\"true\"\n\t(onTestimonialCardClick)=\"modal.openModal()\">\n</app-testimonials>\n<app-related [relatedData]=\"relatedInfo\"></app-related>\n<!-- <app-modal\n\t#modal\n\t[testimonial]=\"testimonials.current\"\n\t(onPrev)=\"onPrevTestimonial()\"\n\t(onNext)=\"onNextTestimonial()\">\n</app-modal> -->"

