module.exports = "<app-chapter-hat [data]=\"chapterHatInfo\"></app-chapter-hat>\n<article \n    class=\"chapter-content\"\n    #articleContainer>\n    <!-- Share aqui -->\n    <div class=\"container-fluid\">\n        <div class=\"row\">\n            <div class=\"col-md-6 offset-md-3 col-sm-10 offset-sm-1 col-12\">\n                <p>Não existe lugar tão alto que não se possa alcançar, nem tão longe que não se possa chegar.</p>\n                <p>Temos altas expectativas. Temos sonhos.</p>\n                <p>Acreditamos no talento do jovem brasileiro e no poder transformador da educação.</p>\n                <p>Acreditamos no mérito e no esforço individual porque tudo que é conquistado tem mais valor.</p>\n                <p>Vivemos em uma sociedade desigual.</p>\n                <p>Tanto potencial desperdiçado pela falta de oportunidades.</p>\n                <p>Somos todos responsáveis.</p>\n                <p>Eu, você, nós do Ismart.</p>\n                <p>Os alunos. Seus pais.</p>\n                <p> Os professores. A escola.</p>\n                <p>Trabalhando em conjunto com outros agentes de transformação, identificamos talentos acadêmicos de baixa renda e oferecemos a estes jovens a oportunidade de ser mais, de sonhar mais alto, de chegar mais longe. Damos acesso à melhor educação de ensino médio para que conquistem uma vaga nas melhores universidades, desenvolvam seu pleno potencial e se tornem profissionais de sucesso em suas áreas de atuação.</p>\n                <p>Para que se tornem, um dia, também eles, agentes de transformação. Motivamos e apoiamos nossos alunos na longa jornada da educação, na longa jornada da vida em busca do sucesso e da felicidade. </p>\n                <p>Trabalhamos por um futuro melhor para os jovens e para o Brasil.</p>\n            </div>\n        </div>\n    </div>\n</article>\n<app-related [relatedData]=\"relatedInfo\"></app-related>\n"

